import React from 'react';
import { View, Text } from 'react-native-web';
import Avatar from '../Avatar/ShowAvatar/showAvatar';

const SearchBody = ({ data }) => {
  const { name, avatar, onPress } = data;
  return (
    <TouchableHighlight  onPress={onPress}>
    <View style={{ backgroundColor: '#E7DEDE', padding: 10 }}>
      {avatar && <Avatar imageUrl={avatar} nickname={name}/>}
      {name && <Avatar nickname={name}/>}
    </View>
    </TouchableHighlight>
  );
};

export default SearchBody ;
